import React from "react";
import "./App.css";
import CustomButton from "./components/Button";
import UserPhoto from "./components/UserPhoto";
import UserMenu from "./components/UserRestaurantMenu";
import UserLogin from "./components/Header";
import UserModal from "./components/UserModal";
import UserDirectionInfo from "./components/UserDirectionInfo";
import LogIn from "./components/UserLogIn";
import FormDirection from "./components/UserFormDirection";
import SignIn from "./components/UserSignIn";
import GoogleLogin from "react-google-login";
responseGoogle = (response) => {
  console.log(response);
  console.log(response.profileObj);
};
function App() {
  return (
    <div>
      Hola Koders de aCOMER
      <UserPhoto />
      <UserLogin />
      <UserMenu />
      <CustomButton />
      <UserModal />
      <UserDirectionInfo />
      <FormDirection />
      <SignIn />
      <LogIn />
      <GoogleLogin
        clientId="268029895097-ena92hfakj1dvi8ng9uagllejjfo90b7.apps.googleusercontent.com"
        buttonText="Login"
        onSuccess={this.responseGoogle}
        onFailure={this.responseGoogle}
        cookiePolicy={"single_host_origin"}
      />
    </div>
  );
}

export default App;
